import React, { Component } from "react";
import Slider from "react-slick";
import styled from "styled-components";
import { FC } from "react";
const SliderElement = styled.div`
background-color:white;
height:100px;
`;
const SliderBox = styled.div`
  height: 150px;
  margin: 20px;
  background-color: black;
  justify-content: center;
  border-radius: 5%;
  box-shadow: 4px 4px 8px 1px #8e8e8e;
  border-radius: 5px;
`;
const Margin = styled.div`
  max-width: 810px;
  margin-left: 65px;
`;
const Workspace = styled.img`
height:20px;
width:20px;
`;
export default class SuperSlider extends Component {
  render() {
    const settings = {
      dots: true,
      infinite: true,
      speed: 500,
      slidesToShow: 3,
      slidesToScroll: 3,
    };
    return (
      <Margin>
        <Slider {...settings}>
          <SliderBox>
            <SliderElement>
              <Workspace src="/media/images/workspace.jpg"/>
            </SliderElement>
          </SliderBox>

          <SliderBox>
            <SliderElement>
              2
              <img src="../../../public/media/icons/house.png" alt=""></img>
            </SliderElement>
          </SliderBox>

          <SliderBox>
            <SliderElement>
              3
            </SliderElement>
          </SliderBox>
          
          <SliderBox>
            <SliderElement>
              4
            </SliderElement>
          </SliderBox>
          
        </Slider>
      </Margin>
    );
  }
}
